import React from 'react';

const MovieList = (props) => {
	return (
		<>
			{props.movies.map((movie, index) => (
				<div className='image-container d-flex justify-content-start m-3' style={{border: '1px solid black', marginBottom: '2rem'}}>
					<img src={movie.Poster} alt={movie.Title} style={{marginBottom: '2rem'}}></img>
					<div style={{display: 'flex', flexDirection: 'row', justifyContent: 'center', alignItems: 'center'}}>
						<div className='title-year' style={{display: 'flex', flexDirection: 'column', justifyContent: 'space-evenly', alignItems: 'center'}}>
							<h4>{movie.Title}</h4>
							<h2>{movie.Year}</h2>
						</div>
						<div className='rate'>
							<h2>{movie.Rated}</h2>
						</div>
					</div>
				</div>
			))}
		</>
	);
};

export default MovieList;
